import React, { useState, useEffect } from 'react';
import { CardGroup } from 'react-bootstrap';
import MovieListingComponent from './MovieListing.component';
import productData from '../data/product.json';

function MovieListing(props) {
	useEffect(() => {
		fetch('https://api.themoviedb.org/4/list/1?api_key=0bd2290e90ff36d0efef4f8f07db8f79').then(
			response => console.log(response.results)
		);
	});

	console.log(productData);
	const productList = productData.Products.map((product, index) => {
		return (
			<MovieListingComponent
				key={index}
				imgsrc={product.imgUrl}
				productTitle={product.name}
				price={product.price}
				desc={product.description}
				//addtoCartHandler={this.props.cartCountUpdater}
			/>
		);
	});

	return <CardGroup>{productList}</CardGroup>;
}

export default MovieListing;
